import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <div className='container-fluid cabecera'>
                    <di className='row'>
                        <div className='logo'>
                            <div className='content'>
                                <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg'></img>
                            </div>
                        </div>
                        <div className='opciones'>text-align: center;</div>
                    </di>
                </div>
                <div>Body</div>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                }                

                .cabecera .logo{
                    width: 10%;
                    border: solid 1px;
                }

                .cabecera .opciones{
                    width: 90%;
                    border: solid 1px;   
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
